class Solution(object):
    def robotSim(self, commands, obstacles):
        ## 0:+y 1:+x 2:-y 3:-4
        # def dir(direction,input_direction):
        #     if input_direction == -1:
        #         # direction = (direction + 1) // 4
        #         direction += 1
        #         direction //=4

        #     else:
        #         direction = (direction-1) //4

        # def ample(direction):
        #     if direction ==0:
        #         p[1] = p[1] + 1
        #     elif direction ==2:
        #         p[1] = p[1] - 1
        #     elif direction ==1:
        #         p[0] = p[0] +1
        #     elif direction == 3:
        #         p[0] = p[0] -1
        
        # def ampleback(direction):
        #     if direction ==0:
        #         p[1] = p[1] - 1
        #     elif direction ==2:
        #         p[1] = p[1] + 1
        #     elif direction ==1:
        #         p[0] = p[0] -1
        #     elif direction == 3:
        #         p[0] = p[0] +1  


        max_val = 0
        p=[0,0]
        direction = 0
        for i in commands:
            if i is -1:
               direction = (direction + 1) % 4
            elif i is -2:
               direction = (direction - 1) % 4
            else:
                step=i
                while step!=0:
                    ample(direction)
                    step -=1
                    if p in obstacles:
                        ampleback(direction)
                        break
                    print(p)
            max_val = max(max_val,p[0]**2+p[1]**2)
                    

        return (max_val)




        

